import React, { useState } from 'react';
import './Result.styles.css';
import { useSelector } from 'react-redux';



export default function Result() {
 const {totalMoves} = useSelector((state) => state.movesSlice)

 
  return (
    <div  className='results'>
        <a href="https://youtube.com/c/shortcode" target="_blank">
            <span> </span>
            <span> </span>
            <span> </span>
            <span> </span>
            {totalMoves}
        </a>
        <div class="wrapper">
            <div id="bottom-bar">
                <div class="bottom-bar-element">
                    <h3 className='result-title'>Moves</h3>
                    <span className='result-number'>{totalMoves}</span> 
                </div>
            </div>
        </div>
    </div>
    )
}
